import { Link } from 'react-router-dom';
import { FaBars, FaHouseUser } from "react-icons/fa";
import { RiAppsLine } from "react-icons/ri";
import { GiOfficeChair } from "react-icons/gi";

function MainNavigation() {
  return(
    <div className="flex flex-col w-64 h-screen px-4 py-8 bg-white border-r dark:bg-gray-800 dark:border-gray-600">
        <nav>
          <ul className="mt-10">
            <li className="px-6 py-2 text-gray-500 hover:text-gray-500">
              <Link to="/home"><FaHouseUser size={30} /></Link>
            </li>
            <li className="px-6 py-2 text-gray-500 hover:text-gray-500">
              <Link to="/yourbooking"><RiAppsLine size={30} /></Link>
            </li>
            <li className="px-6 py-2 text-gray-500 hover:text-gray-500">
              <Link to="/selectnewbooking"><GiOfficeChair size={30}/></Link>
            </li>
            <li className="px-6 py-2 text-gray-500 hover:text-gray-500">
              <Link to="/More"><FaBars size={30}/></Link>
            </li>
          </ul>
        </nav>
    </div>
  );
}

export { MainNavigation };
